import React, {Component} from 'react';
import './App.css';
import {Box, Image} from 'grommet';

class App extends Component {
    state = {
        products: []
      }
      componentDidMount() {
        fetch('https://www.mocky.io/v2/5e86ec5531000011d8814754')
        .then(res => res.json())
        .then((data) => {
          this.setState({ products: data })
        })
        .catch(console.log)
      }
// console.log(products.products.compareSummary)
// console.log(Object.values(image)) 
render() {
    const products = this.state.products;
  return (
      <div>
      <div>{products.products !== undefined ?
             [products.products.compareSummary.images].map(image =>
            (<Box height="small" width="small">
  <Image
    fit="cover"
    src="https://rukminim1.flixcart.com/image/1000/1000/jj367bk0/television/g/c/6/vu-40d6575-original-imaf6qqy4vfneabe.jpeg?q=100"
  />
</Box>
            )
          ): ''}</div>
      </div>
  );
}


}
export default App;
